import React from 'react';
import './index.css';

function App() {
  return (
    <div className="grid grid-cols-1 gap-4 m-5 justify-center">
      <div>
        <h1 className="text-3xl font-bold font-sans">My Tasks</h1>
      </div>
      <div className="form-check flex flex-row items-start">
        <input type="checkbox" className="w-4 h-4 mt-2 rounded-full focus:ring-1"/>
        <div className="ml-3">
          <p className="text-xl font-medium">Task Name</p>
          <p className="text-sm text-gray">Task Description</p>
        </div>
      </div>
    </div>
  );
}

export default App;
